query:
/*+ NoMergeJoin(mk t) NoHashJoin(mk t ci) */ select count(*)
from movie_keyword AS mk
inner join title AS t
on t.id = mk.movie_id AND mk.keyword_id = 2199 AND t.kind_id = 7 AND t.production_year > 2009
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id < 2771197 AND ci.role_id > 2;
